import Link from 'next/link';
import Layout from '../components/Layout';

export default () => (
    <Layout>
        <div>
            <h1>Home</h1>
            <Link href="/about"><a>Go to the about page</a></Link>
            <p>Welcome to the home page</p>
        </div>
    </Layout>
);
